import React, { useEffect, useState } from 'react';
import Axios from 'axios';
import { useLoadScript } from "@react-google-maps/api"
//   url: https://maps.googleapis.com/maps/api/place/textsearch/json?query=[yourquerystring]&key=[YOURAPIKEY]


function GetPlace(props) {

  const gmapikey = "AIzaSyCnTuvtwFKq21_w9gpZgcPKOFsX6FVQi0I";

  const [place, setPlace] = useState("");

  var queryString = props.placeType + "&inputtype=textquery&locationbias=circle%3A2000%" + props.lat + "%2C" + props.lon + "&fields=formatted_address%2Cname%2Crating%2Copening_hours%2Cplace_id%2Ctypes%2Cwebsite%2Cgeometry%2Cserves_beer%2Cserves_breakfast%2Cserves_brunch%2Cserves_dinner%2Cserves_lunch%2C";

  const getNewPlace = () => {
    console.log(gmapikey)
    Axios.get("https://maps.googleapis.com/maps/api/place/textsearch/json?query=" + queryString + "&key=" + gmapikey).then(
        (response) => {
            console.log(response)
            setPlace(response.data);
        }
    );
  };

  return (
    <div>
      <header>
              <button onClick={getNewPlace}>
                Get new Place
              </button>
      </header>
    </div>
  );
}

export default GetPlace;
